import React, { Component } from "react";
import Todomap from "./todomap";
class app extends Component {
  constructor() {
    super();
    this.state = {
      todos: [
        {
          id: 1,
          title: "todo 1",
          completed: true,
        },
        {
          id: 2,
          title: "todo 2",
          completed: false,
        },
        {
          id: 3,
          title: "todo 3",
          completed: false,
        },
      ],
    };
  }
  render() {
    return (
      <div>
        <Todomap todo={this.state.todos} handle={this.handle} />
      </div>
    );
  }
}

export default app;
